  \"2016-07-27T23:02:35.832659\",\n\t\"name\": \"nowitna-nwr-wolf-survey-1988\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This report summarizes the results of an
  aerial wolf survey that was conducted on the Nowitna National Wildlife Refuge in
  April of 1988. Survey flightlines followed the Nowitna and Yukon rivers and their
  major tributaries and major ridges in the Monzonite Hills and foothills of the Kuskokwim
  Mountains. Twenty-seven observations of wolf tracks and/or wolves were recorded,
  including sightings of five wolf packs containing 26 wolves. Enumeration of tracks
  and direct sightings resulted in an estimate of 52 wolves in 9 packs with territories
  entirely or partially within the refuge. Comparisons with previous surveys are presented.\",\n\t\"license_title\":
